import React, { useMemo } from "react";
import NavBar from "./NavBar";
import { players } from "./nba_player_data_20-21-";
import { useTable } from "react-table-6";
// import nba_player_data_20-21-- from "./nba_player_data_20-21--.json"
import { COLUMNS } from "./components/columnsAP";

const AllPlayers = () => {
  const data = () => {
    // const d = JSON.parse(players);
    console.log("hello");
    // console.log(Object.entries(players));
    console.log(players);
  };

  const columns = useMemo() 

  useTable({
    columns: COLUMNS,
    data: players,
  });

  // console.table(data);

  return (
    <div>
      <button onClick={data}>Click</button>
      <table>
        <tr>
          <th>Company</th>
          <th>Contact</th>
          <th>Country</th>
        </tr>
        <tr>
          <td>Alfreds Futterkiste</td>
          <td>Maria Anders</td>
          <td>Germany</td>
        </tr>
        <tr>
          <td>Centro comercial Moctezuma</td>
          <td>Francisco Chang</td>
          <td>Mexico</td>
        </tr>
      </table>
      <h1></h1>
    </div>
  );
};

// the home page with the items and the stuff at the bottom
const Home = () => (
  <div>
    <NavBar />
    <header>
      <h1>Welcome to All Players</h1>

      <AllPlayers />
    </header>
  </div>
);

export { AllPlayers, Home };
